-- ----------------------------
--  Table structure for `geo_city`
-- ----------------------------
DROP TABLE IF EXISTS `geo_city`;
CREATE TABLE `geo_city` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `province_id` int(11) DEFAULT '0' COMMENT '所属省份',
  `name` varchar(100) NOT NULL COMMENT '名称',
  `short` varchar(50) DEFAULT '' COMMENT '简称',
  `zip_code` varchar(30) DEFAULT '' COMMENT '邮编号码',
  `zone_code` varchar(30) DEFAULT '' COMMENT '区号',
  `desc` text COMMENT '描述',
  `date_created` int(11) DEFAULT '0' COMMENT '创建时间',
  `date_updated` int(11) DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3204 DEFAULT CHARSET=utf8 COMMENT='公共/城市';

