DROP TABLE IF EXISTS `geo_district`;
CREATE TABLE `geo_district` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `city_id` int(10) NOT NULL DEFAULT '0' COMMENT '所属城市',
  `name` varchar(100) NOT NULL DEFAULT '' COMMENT '名称',
  `short` varchar(50) DEFAULT '' COMMENT '缩写',
  `zip_code` varchar(30) DEFAULT '' COMMENT '邮编',
  `zone_code` varchar(30) DEFAULT '' COMMENT '区号',
  `desc` varchar(1000) DEFAULT NULL COMMENT '描述',
  `date_created` int(11) DEFAULT '0',
  `date_updated` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3214 DEFAULT CHARSET=utf8 COMMENT='公共/地区';

